import httpClient from "@/utils/httpclient";
import model from "@/components/model";
export default {
  name: "vehicleForm",
  components: {
    model: model
  },
  props: ['vehicleInfo'],
  data: function data() {
    return {
      title: '',
      content: '',
      show: false,
      showB: false,
      vin: '',
      data: {},
      year: '',
      make: '',
      trim: '',
      engine: '',
      price: '',
      stock: '',
      condition: 'new',
      odometer: '',
      model: '',
      color: 'Black',
      date: '',
      plate: '',
      photo: '',
      deviceMac: ''
    };
  },
  watch: {
    'vehicleInfo': {
      immediate: true,
      handler: function handler(curVal) {
        console.log("---watch-----");
        console.log(curVal);
        this.showB = false;
        this.data = curVal;
        this.year = this.data.year;
        this.make = this.data.make;
        this.model = this.data.model;
        this.trim = this.data.trim;
        this.engine = this.data.engineType;
        this.price = this.data.price;
        this.color = this.data.color;
        this.date = this.data.inventoryDays;
        this.stock = this.data.stockNumber;
        this.condition = this.data.vehicleType;
        this.odometer = this.data.currentMileage / 1609.344;
        this.plate = this.data.plate;
        this.photo = this.data.photoPath;
        this.vin = this.data.vin;
        this.deviceMac = this.data.mac;
      },
      deep: true
    }
  },
  methods: {
    savefile: function savefile(event) {
      var _this = this;

      var file = event.target.files;
      var fb = new FormData();
      fb.append("image", file[0]);
      httpClient.post('/api/v1/user/updateAvatar', fb).then(function (response) {
        if (response.data.code == 200) {
          _this.photo = response.data.data.avatarUrl;
          _this.title = "Success";
          _this.content = "Photo Uploaded Successfully";
          _this.show = true;
          _this.showB = false;
        }
      }).catch(function (error) {
        console.error(error);
      });
    },
    saveData: function saveData() {
      var _this2 = this;

      httpClient.post('/api/v1/vehicle/bind/device', {
        vin: this.vin,
        year: this.year,
        make: this.make,
        deviceMac: this.deviceMac,
        model: this.model,
        trim: this.trim,
        engineType: this.engine,
        color: this.color,
        price: Number(this.price) ? this.price : '',
        stockNumber: this.stock,
        inventoryDate: new Date(this.date).getTime(),
        vehicleType: this.confidence,
        currentMileage: this.odometer,
        plate: this.plate,
        photoPath: this.photo
      }).then(function (response) {
        _this2.$emit("showStep3", response.data.data);
      }).catch(function (err) {
        console.log("server error");
      });
    }
  }
};
